import React from "react";

const Home = () => (
  <div>
    <p className="has-text-weight-bold has-text-danger">Home page</p>
    <button className="button is-primary">Profile</button>
    <button className="button is-link">Analysis</button>
    <button className="button is-info">Image processing</button>
  </div>
);

export default Home;
